webpackJsonp([0x624e17607b5c],{486:function(e,n){e.exports={data:{markdownRemark:{html:"<blockquote>\n<p>Message 1615 : Mon Sep  5 (Blent)      :: Changes: Toboldo, Jaiden, Grub</p>\n</blockquote>\n<p>Some minor changes will be in effect as of next reboot:</p>\n<p>Toboldo will no longer give his quest to evil races.</p>\n<p>Jaiden will now re-follow if you happen to lose him while\nleading him to his destination.</p>\n<p>The grub-like creature in the underground streambed zone has changed. It\nno longer has to be triggered to load (frankly, the trigger made no sense\nanyway)... which means that this mob is now a permanent resident of its\nlittle part of the cave system. Travelers be warned!</p>\n<p>In addition, the butcher for the grub-like creature has been made\nslightly easier.</p>\n<p>Any problems, questions, or concerns, send me a game mail.\nBlent</p>",frontmatter:{title:"News 1615: Changes: Toboldo, Jaiden, Grub",date:"October 09, 2017",author:null,desc:null}}},pathContext:{slug:"/news/1615"}}}});
